//import logo from './logo.svg';
//import APICall from './API';
import Dropdown from './components/Dropdown/dropdown';
import './App.css';

function App() {
  const data = [
    { value: 1, name: 'A' },
    { value: 2, name: 'B' },
    { value: 3, name: 'C' },
  ];
  return (
    <div className='App'>
      <Dropdown options={data} />
    </div>
  );
}

export default App;
